import styled from "styled-components";
import { TRoom } from "../../types/chat"; 

const ExPersonalChatWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
`;

const PersonalList = styled.div`
  width: 100%;

`; 



const PChatItemWrapper = styled.div`
  width: 100%;
  padding: 15px;
`; 


interface Props { 

}


interface PCItemProps { 
  readonly item: TRoom; 
}

const personals: TRoom[] = [ 
  {
    id: 0,
    roomKey: 'roombot1',
    roomName: '챗봇01',
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false
  },
  {
    id: 0,
    roomKey: 'roombot2',
    roomName: '챗봇02',
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false
  },
  {
    id: 0,
    roomKey: 'roombot3',
    roomName: '챗봇03', 
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false
  }

];

const ExPersonalChat = ({  }:Props):JSX.Element=> {

  return (
    <ExPersonalChatWrapper> 
      {personals.length === 0 && <p>No Data</p>}   
      <PersonalList>
          {personals.map((item: TRoom) => (
            <PersonalChatItem item={item}/>
          ))}  
      </PersonalList>
    </ExPersonalChatWrapper> 
  )

}



const PersonalChatItem = ({ item }: PCItemProps): JSX.Element => {   
  return (
    <PChatItemWrapper>
      {item.roomName}
    </PChatItemWrapper>
  );
}


export default ExPersonalChat;
